column8:
■製品特徴<br>新ウィズワンは，食物繊維（プランタゴ・オバタ種皮）と生薬（センノシド，カスカラサグラダ）を配合した，自然に近いお通じを促す便秘薬です。<br>●おだやかに作用しますので，便秘薬を初めて使用される方にもおすすめです。<br>●持ち運び可能なスティック包装，服用しやすいチョコレート風味のサラサラ顆粒です。<br>●便秘のないすっきり快適な生活を送るために，バランスの取れた食事，適度な運動，ストレスを溜めない生活を心がけ，それでも困ったときにはウィズワンで治しましょう！<br><br>■使用上の注意<br>   ■してはいけないこと■<br>（守らないと現在の症状が悪化したり，副作用が起こりやすくなります）<br>  1．本剤を服用している間は，次の医薬品を服用しないでください<br>　他の瀉下薬（下剤）<br>2．授乳中の人は本剤を服用しないか，本剤を服用する場合は授乳を避けてください<br>3．大量に服用しないでください<br> ▲相談すること▲<br>  1．次の人は服用前に医師，薬剤師又は登録販売者に相談してください<br>　（1）医師の治療を受けている人。<br>　（2）妊婦又は妊娠していると思われる人。<br>　（3）薬などによりアレルギー症状を起こしたことがある人。<br>　（4）次の症状のある人。<br>　　はげしい腹痛，吐き気・嘔吐<br>2．服用後，次の症状があらわれた場合は副作用の可能性があるので，直ちに服用を中止し，商品添付文書を持って医師，薬剤師又は登録販売者に相談してください<br>［関係部位：症状］<br>皮膚：発疹・発赤，かゆみ<br>消化器：はげしい腹痛，吐き気・嘔吐<br>3．服用後，次の症状があらわれることがあるので，このような症状の持続又は増強が見られた場合には，服用を中止し，医師，薬剤師又は登録販売者に相談してください<br>　下痢<br>4．1週間位服用しても症状がよくならない場合は服用を中止し，商品添付文書を持って医師，薬剤師又は登録販売者に相談してください<br> <br>■効能・効果<br>便秘。<br>便秘に伴う次の症状の緩和：<br>肌あれ，吹出物，頭重，のぼせ，食欲不振（食欲減退），腹部膨満，腸内異常発酵，痔<br> <br>■用法・用量<br>1日1-3回食後に服用してください。<br>ただし，初回は最小量を用い，便通の具合や状態をみながら少しずつ増量又は減量してください。<br>［年齢：1回量］<br>成人（15才以上）：3／4-1包<br>11才以上15才未満：1／2-2／3包<br>3才以上11才未満：1／4-1／3包<br>3才未満：服用しないでください。<br><br>【用法関連注意】<br>（1）小児に服用させる場合には，保護者の指導監督のもとに服用させてください。<br>（2）定められた用法・用量を厳守してください。<br>（3）コップ1杯（約180mL）の水又はぬるま湯でかまずにおのみください。<br><br>＜成分・分量に関連する注意＞<br>本剤の服用により，尿が黄褐色又は赤色になることがありますが，これは主成分のセンノシドによるものですから心配ありません。<br><br>■成分分量  3.6g(3包)中<br> プランタゴ・オバタ種皮末 3000mg<br>  センノシド 83.53mg （内訳：センノシドA・B 32.58mg）<br> カスカラサグラダ乾燥エキス 53.6mg （内訳：カスカラサグラダ300mg）<br> 添加物として<br>乳糖水和物，l-メントール，アセスルファムカリウム，香料，エチルバニリン，バニリン<br>を含有します。<br><br>■剤形：散剤<br><br> ■保管及び取扱い上の注意<br>（1）直射日光の当たらない湿気の少ない涼しい所に保管してください。<br>（2）小児の手のとどかない所に保管してください。<br>（3）他の容器に入れかえないでください。（誤用の原因になったり品質が変わることがあります。）<br>（4）1包を分割して服用した残りは，袋の口を折り返して保管し，出来るだけ早く服用してください。<br>（5）使用期限を過ぎた製品は服用しないでください。<br>  <br><br>【お問合せ先】<br>こちらの商品につきましては、<br>当店（ドラッグピュア）または、下記へお問い合わせください。<br>ゼリア新薬工業株式会社　お客様相談室<br>住所：〒103-8351<br>東京都中央区日本橋小舟町10-11<br>電話：03-3661-2080<br>受付時間：9:00-17:00(土、日、祝祭日を除く) <br><br><br>広告文責：株式会社ドラッグピュア<br>作成：201604SN<br>神戸市北区鈴蘭台北町1丁目1-11-103<br>TEL:0120-093-849<br>製造販売：ゼリア新薬工業株式会社<br>区分：指定第2類医薬品・日本製<br>文責：登録販売者　松田誠司<br><br><br><font color="#cc0000"> ■ <b>関連商品</b></font><br> <style type="text/css"> <!-- .u1 { list-style-image: url(http://image.rakuten.co.jp/drugpure/cabinet/signboard/list-red.gif);margin: 0 0 0 20px; padding: 0;} --> </style> <ul class="u1"><li>ゼリア新薬お取り扱い商品</li><li>ウィズワンシリーズ</li></ul><!--[if lte IE 7 ]>
